import React from 'react'

import Select from '../../../components/form/Select'

const SelectPokemonsOrder = ({ onChange, value }) => {
	const options = [
		{ label: 'Numéro', value: 'number' },
		{ label: 'Ataque', value: 'atk' },
		{ label: 'Defesa', value: 'def' },
		{ label: 'Stamina', value: 'sta' }
	]

	return <Select inputOnly onChange={onChange} options={options} value={value} />
}

export default SelectPokemonsOrder
